import React from 'react';

const ContactPage = () => {
  return (
    <div>
      <h1>Liên hệ</h1>
      <p>Nếu bạn cần hỗ trợ, vui lòng gửi email đến: support@example.com</p>
    </div>
  );
};

export default ContactPage;
